# Define possible moves
MOVES = [(-1, 0), (0, 1), (1, 0), (0, -1)]

def hash_pos(pos, direction):
    """Create a unique hash for position and direction."""
    return (pos[0], pos[1], direction[0], direction[1])

def test(test_data):
    """Simulate the movement and detect loops."""
    # Find the initial position of "^"
    start_pos = next((i, j) for i, row in enumerate(test_data) for j, cell in enumerate(row) if cell == "^")
    
    current_pos = list(start_pos)
    current_dir = MOVES[0]
    pos_history = set()
    result_set = set()
    
    while True:
        pos_hash = hash_pos(current_pos, current_dir)
        
        # Check for loop
        if pos_hash in pos_history:
            return True
        
        pos_history.add(pos_hash)
        
        # Check boundaries
        next_row = current_pos[0] + current_dir[0]
        next_col = current_pos[1] + current_dir[1]
        
        if not (0 <= next_row < len(test_data) and 0 <= next_col < len(test_data[0])):
            break  # Out of bounds
        
        # Handle obstacles
        if test_data[next_row][next_col] == "#":
            current_dir = MOVES[(MOVES.index(current_dir) + 1) % 4]
        else:
            result_set.add((current_pos[0], current_pos[1]))
            current_pos[0], current_pos[1] = next_row, next_col

    return False

