result = 0
data_copy = [row[:] for row in data]

for i, row in enumerate(data):
    for j, cell in enumerate(row):
        if cell == ".":
            data_copy[i][j] = "#"
            if test(data_copy):
                result += 1
            data_copy[i][j] = "."
        print(f"{i * len(data[0]) + j} / {len(data) * len(data[0])}")

